import React from 'react';
import { FaHome, FaUtensils, FaBullhorn, FaChartBar, FaCog, FaVideo, FaUsers, FaStore } from 'react-icons/fa';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Breezy Admin</h2>
      <nav>
        <a href="#"><FaHome className="icon" /> Tổng quan</a>
        <a href="#"><FaUtensils className="icon" /> Quản lý menu</a>
        <a href="#"><FaBullhorn className="icon" /> Nội dung & Thông báo</a>
        <a href="#"><FaChartBar className="icon" /> Khuyến mãi & Voucher</a>
        <a href="#"><FaChartBar className="icon" /> Thống kê & Báo cáo</a>
        <a href="#"><FaVideo className="icon" /> Quản lý Video</a>
        <a href="#"><FaStore className="icon" /> Chi nhánh</a>
        <a href="#"><FaUsers className="icon" /> Người dùng</a>
        <a href="#"><FaCog className="icon" /> Cài đặt</a>
      </nav>
      <div className="admin-info">
        <hr />
        <p><strong>Admin Nguyen</strong></p>
        <span>Quản trị viên</span>
      </div>
    </div>
  );
}

export default Sidebar;
